import{_ as i,c as t,o,ag as r}from"./chunks/framework.DPDPlp3K.js";const e="/images/register.jpg",s="/images/login.jpg",a="/images/dashboard.jpg",n="/images/project.jpg",h="/images/Brower.jpg",d="/images/wallet.jpg",c="/images/proxy.jpg",u="/images/captcha.jpg",p="/images/tools.jpg",_=JSON.parse('{"title":"快速开始","description":"","frontmatter":{"prev":{"text":"介绍","link":"/guide/"}},"headers":[],"relativePath":"guide/getting-started.md","filePath":"guide/getting-started.md","lastUpdated":1742017746000}'),q={name:"guide/getting-started.md"};function b(g,l,m,P,k,f){return o(),t("div",null,l[0]||(l[0]=[r('<h1 id="快速开始" tabindex="-1">快速开始 <a class="header-anchor" href="#快速开始" aria-label="Permalink to &quot;快速开始&quot;">​</a></h1><p>本章节将帮助您快速上手 ToMoon，了解从注册到执行脚本的完整操作流程，让您能够在最短的时间内开始使用这款强大的自动化工具。</p><h2 id="安装-tomoon" tabindex="-1">安装 ToMoon <a class="header-anchor" href="#安装-tomoon" aria-label="Permalink to &quot;安装 ToMoon&quot;">​</a></h2><p>首先，您需要下载并安装 ToMoon 应用程序：</p><ol><li>访问<a href="/download.html">下载页面</a>，选择适合您操作系统的版本</li><li>下载安装包后，按照安装向导完成安装</li><li>安装完成后，启动 ToMoon 应用程序</li></ol><div class="tip custom-block"><p class="custom-block-title">提示</p><p>如果您在安装过程中遇到问题，请参考<a href="/guide/installation.html">安装指南</a>获取详细帮助。</p></div><h2 id="注册与登录" tabindex="-1">注册与登录 <a class="header-anchor" href="#注册与登录" aria-label="Permalink to &quot;注册与登录&quot;">​</a></h2><h3 id="注册账号" tabindex="-1">注册账号 <a class="header-anchor" href="#注册账号" aria-label="Permalink to &quot;注册账号&quot;">​</a></h3><p>首次使用 ToMoon，您需要注册一个账号：</p><ol><li>在登录界面点击&quot;立即注册&quot;按钮</li><li>填写您的邮箱地址</li><li>输入密码并确认密码（密码长度至少6位）</li><li>输入验证码（验证码将发送到您的邮箱）</li><li>点击&quot;注册&quot;按钮完成注册</li></ol><p><img src="'+e+'" alt="注册界面"></p><div class="warning custom-block"><p class="custom-block-title">注意</p><p>请使用真实有效的邮箱，验证码将发送到该邮箱，且该邮箱将用于接收重要通知和找回密码。注册账号仅限个人使用，仅注册设备可使用，如遇需要更换设备情况，请联系客服解决。</p></div><h3 id="登录账号" tabindex="-1">登录账号 <a class="header-anchor" href="#登录账号" aria-label="Permalink to &quot;登录账号&quot;">​</a></h3><p>注册完成后，您可以使用注册的邮箱和密码登录：</p><ol><li>在登录界面输入您的邮箱地址</li><li>输入密码</li><li>输入图形验证码</li><li>点击&quot;登录&quot;按钮</li></ol><p><img src="'+s+'" alt="登录界面"></p><div class="tip custom-block"><p class="custom-block-title">提示</p><p>如果您忘记了密码，可以点击&quot;忘记密码&quot;链接，通过邮箱验证的方式重置密码。</p></div><h2 id="界面概览" tabindex="-1">界面概览 <a class="header-anchor" href="#界面概览" aria-label="Permalink to &quot;界面概览&quot;">​</a></h2><p>登录ToMoon后，您将看到主界面，左侧是导航菜单，右侧是内容区域。</p><p><img src="'+a+'" alt="主界面"></p><h3 id="导航菜单" tabindex="-1">导航菜单 <a class="header-anchor" href="#导航菜单" aria-label="Permalink to &quot;导航菜单&quot;">​</a></h3><p>ToMoon的主要功能模块包括：</p><ul><li><strong>仪表盘</strong>：显示钱包数量、任务执行情况和会员状态等概览信息</li><li><strong>项目自动化</strong>：执行各种Web3项目的自动化任务</li><li><strong>浏览器自动化</strong>：配置和运行浏览器自动化脚本</li><li><strong>代理配置</strong>：管理代理池，使用代理避免被屏蔽和女巫</li><li><strong>实用工具</strong>：提供提币，查询余额，生成钱包等</li><li><strong>本地钱包</strong>：管理您的加密钱包</li><li><strong>个人设置</strong>：设置captcha解码密钥，修改密码等</li></ul><h2 id="会员系统" tabindex="-1">会员系统 <a class="header-anchor" href="#会员系统" aria-label="Permalink to &quot;会员系统&quot;">​</a></h2><p>ToMoon 暂时提供免费版和PRO版两种使用模式，PRO版可以解锁高级功能。</p><h3 id="会员等级与权益" tabindex="-1">会员等级与权益 <a class="header-anchor" href="#会员等级与权益" aria-label="Permalink to &quot;会员等级与权益&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能</th><th>免费版</th><th>PRO版</th></tr></thead><tbody><tr><td>基础工具使用</td><td>✅</td><td>✅</td></tr><tr><td>项目自动化</td><td>❌</td><td>✅</td></tr><tr><td>浏览器自动化</td><td>❌</td><td>✅</td></tr><tr><td>并发任务数</td><td>2</td><td>最多20</td></tr><tr><td>定时任务</td><td>❌</td><td>✅</td></tr></tbody></table><h3 id="开通会员" tabindex="-1">开通会员 <a class="header-anchor" href="#开通会员" aria-label="Permalink to &quot;开通会员&quot;">​</a></h3><ol><li>在个人设置中点击&quot;开通会员&quot;</li><li>选择您想要购买的会员套餐（月度/季度）</li><li>选择支付方式（支持加密货币支付）</li><li>完成支付后，管理员审核通过后，会员权益将立即生效，仪表盘显示会员标识</li></ol><p><img src="'+a+'" alt="会员中心"></p><h2 id="项目自动化" tabindex="-1">项目自动化 <a class="header-anchor" href="#项目自动化" aria-label="Permalink to &quot;项目自动化&quot;">​</a></h2><p>项目自动化是ToMoon的核心功能，让您能够轻松执行各种Web3任务。</p><p><img src="'+n+'" alt="项目自动化界面"></p><h3 id="界面说明" tabindex="-1">界面说明 <a class="header-anchor" href="#界面说明" aria-label="Permalink to &quot;界面说明&quot;">​</a></h3><ol><li><strong>项目选择区</strong>：左侧显示可用的项目列表，包括&quot;我的收藏&quot;、&quot;当前项目&quot;和&quot;往期项目&quot;</li><li><strong>任务配置区</strong>：选择项目后，右侧显示可用的任务和配置选项</li><li><strong>钱包选择</strong>：可以通过&quot;选择钱包&quot;或&quot;导入钱包&quot;两种方式选择要使用的钱包</li><li><strong>代理设置</strong>：选择要使用的代理池</li><li><strong>并发设置</strong>：设置任务并发数，根据需求设定</li></ol><h3 id="使用流程" tabindex="-1">使用流程 <a class="header-anchor" href="#使用流程" aria-label="Permalink to &quot;使用流程&quot;">​</a></h3><ol><li>从左侧项目列表中选择一个项目</li><li>在右侧选择要执行的任务</li><li>配置任务参数（如果有）</li><li>选择要使用的钱包</li><li>选择代理池</li><li>设置并发数</li><li>点击&quot;开始运行&quot;按钮，任务运行后，会自动弹出日志展示，您可以实时查看任务执行情况</li></ol><h3 id="钱包选择方式" tabindex="-1">钱包选择方式 <a class="header-anchor" href="#钱包选择方式" aria-label="Permalink to &quot;钱包选择方式&quot;">​</a></h3><p>您可以通过两种方式选择钱包：</p><h4 id="方式一-从钱包列表选择" tabindex="-1">方式一：从钱包列表选择 <a class="header-anchor" href="#方式一-从钱包列表选择" aria-label="Permalink to &quot;方式一：从钱包列表选择&quot;">​</a></h4><p>点击&quot;选择钱包&quot;按钮，在弹出的钱包选择器中勾选要使用的钱包。</p><h4 id="方式二-导入临时钱包" tabindex="-1">方式二：导入临时钱包 <a class="header-anchor" href="#方式二-导入临时钱包" aria-label="Permalink to &quot;方式二：导入临时钱包&quot;">​</a></h4><p>点击&quot;导入钱包&quot;按钮，下载并填写导入模板，然后上传。这种方式导入的钱包仅临时使用，不会永久保存。</p><div class="tip custom-block"><p class="custom-block-title">提示</p><p>钱包列表均保存在本地，安全自主，然安全至上，撸毛钱包勿放置大量资金，也可以使用导入钱包方式，任务完成后自动清除。</p></div><h3 id="执行任务" tabindex="-1">执行任务 <a class="header-anchor" href="#执行任务" aria-label="Permalink to &quot;执行任务&quot;">​</a></h3><ol><li>完成配置后，点击&quot;开始运行&quot;按钮</li><li>系统将按照配置的并发数执行任务</li><li>任务执行过程中，您可以实时查看执行日志和进度</li><li>如需停止任务，点击&quot;终止运行&quot;按钮</li></ol><h2 id="浏览器自动化" tabindex="-1">浏览器自动化 <a class="header-anchor" href="#浏览器自动化" aria-label="Permalink to &quot;浏览器自动化&quot;">​</a></h2><p>浏览器自动化功能允许您配置和运行浏览器自动化脚本，执行各种Web操作。</p><p><img src="'+h+'" alt="浏览器自动化界面"></p><h3 id="界面说明-1" tabindex="-1">界面说明 <a class="header-anchor" href="#界面说明-1" aria-label="Permalink to &quot;界面说明&quot;">​</a></h3><ol><li><strong>任务列表</strong>：左侧显示可用的浏览器自动化任务</li><li><strong>配置区域</strong>：右侧是任务配置区域</li><li><strong>浏览器路径</strong>：设置浏览器可执行文件的路径</li><li><strong>钱包选择</strong>：选择要在浏览器中使用的钱包</li><li><strong>代理设置</strong>：配置浏览器使用的代理（暂不可用）</li></ol><h3 id="主要功能" tabindex="-1">主要功能 <a class="header-anchor" href="#主要功能" aria-label="Permalink to &quot;主要功能&quot;">​</a></h3><ul><li><strong>创建浏览器备份</strong>：创建和浏览器备份和浏览器钱包，目前支持chrome浏览器和OKX钱包安装</li><li><strong>登录自动化</strong>：自动完成浏览器打开和钱包登录，便于用户日常管理本地浏览器备份和钱包</li><li><strong>交互操作</strong>：对于必须使用浏览器的项目，提供自动化流程</li><li><strong>特色功能</strong>：使用token登录discord，twitter，也可从已登录的浏览器中获取token</li><li><strong>网页自动化脚本</strong>：实时更新网页自动化脚本，用于撸毛</li></ul><h3 id="使用流程-1" tabindex="-1">使用流程 <a class="header-anchor" href="#使用流程-1" aria-label="Permalink to &quot;使用流程&quot;">​</a></h3><ol><li>从左侧选择一个浏览器任务</li><li>配置浏览器路径和是否无头模式</li><li>选择要使用的钱包，或是导入钱包</li><li>配置代理设置（暂不可用）</li><li>点击&quot;开始运行&quot;按钮</li></ol><div class="tip custom-block"><p class="custom-block-title">提示</p><p>浏览器自动化功能需要在本地安装chrome浏览器，需要设置浏览器备份路径、插件路径等。</p></div><h2 id="钱包管理" tabindex="-1">钱包管理 <a class="header-anchor" href="#钱包管理" aria-label="Permalink to &quot;钱包管理&quot;">​</a></h2><p>ToMoon 提供了强大的钱包管理功能，支持多种链的钱包创建、导入和管理。</p><h3 id="创建钱包" tabindex="-1">创建钱包 <a class="header-anchor" href="#创建钱包" aria-label="Permalink to &quot;创建钱包&quot;">​</a></h3><p><img src="'+d+'" alt="钱包管理界面"></p><ol><li>在本地钱包或实用工具中，点击&quot;生成钱包&quot;进入钱包创建页面</li><li>选择要创建的钱包类型（EVM/SOL/SUI/APT）等</li><li>选择生成数量，点击生成钱包</li><li>也可将已有的助记词放入助记词框，点击生成钱包后便于导入本地钱包</li><li><strong>重要</strong>：安全备份生成的助记词，这是恢复钱包的唯一方式</li></ol><div class="danger custom-block"><p class="custom-block-title">警告</p><p>助记词是您钱包的唯一恢复凭证，请务必安全保存！生成钱包后可导出钱包为EXCEL文件，方便管理。或存于本地数据库中，ToMoon服务器不会存储您的助记词，一旦丢失将无法找回。</p></div><h3 id="导入钱包" tabindex="-1">导入钱包 <a class="header-anchor" href="#导入钱包" aria-label="Permalink to &quot;导入钱包&quot;">​</a></h3><p>您可以通过多种方式导入已有的钱包：</p><h4 id="批量导入钱包" tabindex="-1">批量导入钱包 <a class="header-anchor" href="#批量导入钱包" aria-label="Permalink to &quot;批量导入钱包&quot;">​</a></h4><p>对于需要管理多个钱包的用户，ToMoon 提供了批量导入功能：</p><ol><li>在&quot;钱包管理&quot;页面点击&quot;批量导入&quot;</li><li>下载导入模板（Excel格式）</li><li>按照模板格式填写钱包信息</li><li>上传填写好的模板文件</li><li>点击&quot;导入&quot;按钮</li></ol><h3 id="钱包列表管理" tabindex="-1">钱包列表管理 <a class="header-anchor" href="#钱包列表管理" aria-label="Permalink to &quot;钱包列表管理&quot;">​</a></h3><p>导入或创建的钱包将显示在钱包列表中：</p><ul><li>查看钱包地址、余额和交易历史</li><li>对钱包进行标记和分组</li><li>搜索和筛选钱包</li><li>导出钱包信息（不包含私钥/助记词）</li></ul><h2 id="代理池配置" tabindex="-1">代理池配置 <a class="header-anchor" href="#代理池配置" aria-label="Permalink to &quot;代理池配置&quot;">​</a></h2><p>代理池是提高自动化任务成功率和安全性的关键。ToMoon提供了强大的代理池管理功能。</p><p><img src="'+c+'" alt="代理池配置界面"></p><h3 id="界面说明-2" tabindex="-1">界面说明 <a class="header-anchor" href="#界面说明-2" aria-label="Permalink to &quot;界面说明&quot;">​</a></h3><ol><li><strong>代理池列表</strong>：显示已创建的代理池</li><li><strong>代理池详情</strong>：显示选中代理池的详细信息</li><li><strong>操作按钮</strong>：包括查看配置、删除等操作</li></ol><h3 id="创建代理池" tabindex="-1">创建代理池 <a class="header-anchor" href="#创建代理池" aria-label="Permalink to &quot;创建代理池&quot;">​</a></h3><ol><li>点击&quot;新建代理池&quot;按钮</li><li>输入代理池名称</li><li>选择代理类型动态或固定代理</li><li>根据要求的格式填写代理链接</li><li>点击&quot;保存&quot;按钮</li></ol><h3 id="使用代理池" tabindex="-1">使用代理池 <a class="header-anchor" href="#使用代理池" aria-label="Permalink to &quot;使用代理池&quot;">​</a></h3><p>创建代理池后，您可以在执行自动化任务时选择要使用的代理池。</p><div class="tip custom-block"><p class="custom-block-title">提示</p><p>对于需要高匿名性的任务，建议使用动态代理池，并设置随机字符串，便于脚本执行自动切换代理。</p></div><h2 id="captcha密钥配置" tabindex="-1">Captcha密钥配置 <a class="header-anchor" href="#captcha密钥配置" aria-label="Permalink to &quot;Captcha密钥配置&quot;">​</a></h2><p>目前多数网站设置了captcha验证，为了提高自动化任务的成功率，ToMoon支持配置多种验证码解决方案的API密钥。</p><p><img src="'+u+'" alt="Captcha设置界面"></p><h3 id="支持的验证码服务" tabindex="-1">支持的验证码服务 <a class="header-anchor" href="#支持的验证码服务" aria-label="Permalink to &quot;支持的验证码服务&quot;">​</a></h3><p>ToMoon支持以下验证码解决方案：</p><ul><li><strong>2captcha</strong></li><li><strong>nocaptcha</strong></li><li><strong>yescaptcha</strong></li></ul><h3 id="配置步骤" tabindex="-1">配置步骤 <a class="header-anchor" href="#配置步骤" aria-label="Permalink to &quot;配置步骤&quot;">​</a></h3><ol><li>在左侧导航菜单中点击&quot;个人设置&quot;</li><li>选择&quot;密钥设置&quot;选项卡</li><li>在相应的输入框中输入您的API密钥</li><li>点击&quot;保存密钥&quot;按钮</li></ol><div class="tip custom-block"><p class="custom-block-title">提示</p><p>您需要先在相应的验证码服务提供商网站注册账号并购买积分，然后获取API密钥。</p></div><h2 id="本地工具箱" tabindex="-1">本地工具箱 <a class="header-anchor" href="#本地工具箱" aria-label="Permalink to &quot;本地工具箱&quot;">​</a></h2><p>ToMoon 提供了丰富的本地工具，帮助您更高效地管理资产和执行任务。</p><p><img src="'+p+'" alt="实用工具界面"></p><h3 id="工具箱功能" tabindex="-1">工具箱功能 <a class="header-anchor" href="#工具箱功能" aria-label="Permalink to &quot;工具箱功能&quot;">​</a></h3><p>这里提供了一系列实用的链上工具，帮助您更高效地管理和使用区块链资产：</p><h4 id="交易所提币工具" tabindex="-1">交易所提币工具 <a class="header-anchor" href="#交易所提币工具" aria-label="Permalink to &quot;交易所提币工具&quot;">​</a></h4><ol><li><p><strong>OKX交易所提币</strong>：</p><ul><li>配置OKX交易所API</li><li>设置提币地址和金额</li><li>支持多种代币提取</li><li>需要PRO会员权限</li></ul></li><li><p><strong>币安交易所提币</strong>：</p><ul><li>配置币安交易所API</li><li>设置提币地址和金额</li><li>支持多种代币提取</li><li>需要PRO会员权限</li></ul></li></ol><h4 id="余额查询工具" tabindex="-1">余额查询工具 <a class="header-anchor" href="#余额查询工具" aria-label="Permalink to &quot;余额查询工具&quot;">​</a></h4><ol><li><strong>查询钱包余额</strong>： <ul><li>支持多链余额查询</li><li>查看代币余额和NFT资产</li><li>支持批量查询多个钱包</li><li>导出查询结果</li></ul></li></ol><h4 id="钱包生成工具" tabindex="-1">钱包生成工具 <a class="header-anchor" href="#钱包生成工具" aria-label="Permalink to &quot;钱包生成工具&quot;">​</a></h4><ol><li><strong>钱包生成</strong>： <ul><li>支持生成多种链的钱包（EVM/SOL/SUI/APT等）</li><li>批量生成多个钱包</li><li>导出钱包信息为Excel格式</li><li>可选择直接保存到本地钱包库</li></ul></li></ol><h3 id="使用方法" tabindex="-1">使用方法 <a class="header-anchor" href="#使用方法" aria-label="Permalink to &quot;使用方法&quot;">​</a></h3><ol><li>在左侧导航菜单中点击&quot;实用工具&quot;</li><li>选择您需要使用的工具</li><li>根据界面提示配置相关参数</li><li>点击对应的按钮执行操作</li></ol><div class="tip custom-block"><p class="custom-block-title">提示</p><p>所有工具操作均在本地执行，敏感信息（如API密钥、私钥等）不会上传到服务器，确保您的资产安全。</p></div><h3 id="交易所api配置" tabindex="-1">交易所API配置 <a class="header-anchor" href="#交易所api配置" aria-label="Permalink to &quot;交易所API配置&quot;">​</a></h3><p>使用交易所提币功能需要配置API密钥：</p><ol><li>登录您的交易所账户</li><li>创建API密钥（确保开启提币权限）</li><li>在ToMoon中填入API Key和Secret</li><li>建议设置IP限制，仅允许您的IP地址访问</li></ol><div class="warning custom-block"><p class="custom-block-title">注意</p><p>请妥善保管您的API密钥，不要分享给他人。长时间不用，删除密钥，设置IP白名单。</p></div><h2 id="常见问题解答" tabindex="-1">常见问题解答 <a class="header-anchor" href="#常见问题解答" aria-label="Permalink to &quot;常见问题解答&quot;">​</a></h2><h3 id="任务执行失败怎么办" tabindex="-1">任务执行失败怎么办？ <a class="header-anchor" href="#任务执行失败怎么办" aria-label="Permalink to &quot;任务执行失败怎么办？&quot;">​</a></h3><ol><li>检查网络连接和代理设置</li><li>查看详细错误日志，了解失败原因</li><li>确认钱包余额是否充足</li><li>尝试减少并发数，逐个执行任务</li><li>如问题持续，请联系客服支持</li></ol><h3 id="如何保护我的钱包密钥安全" tabindex="-1">如何保护我的钱包密钥安全？ <a class="header-anchor" href="#如何保护我的钱包密钥安全" aria-label="Permalink to &quot;如何保护我的钱包密钥安全？&quot;">​</a></h3><ol><li>减少助记词复制，也可使用临时导入方式，任务完成后自动清除</li><li>captcha解码API密钥，可以定期在官网更换，避免泄露</li><li>代理设置使用子账户，不需要时可删除子账户</li></ol><h3 id="如何获取技术支持" tabindex="-1">如何获取技术支持？ <a class="header-anchor" href="#如何获取技术支持" aria-label="Permalink to &quot;如何获取技术支持？&quot;">​</a></h3><ol><li>在应用内点击&quot;帮助&quot;按钮</li><li>可在群内咨询</li></ol>',114)]))}const T=i(q,[["render",b]]);export{_ as __pageData,T as default};
